(1061,	7,	'Bishop Joshua',	'Lwere',	'',	'Bishop Joshua Lwere',	'',	'10',	'jlwere@gmail.com',	'jlwere@me.com',	'256772414390',	'256712414390',	NULL,	0,	NULL,	'',	'0',	NULL,	NULL,	'e3c76f',	0,	NULL,	NULL,	'2014-10-07 13:53:11',	279,	'2014-11-26 23:16:31',	1,	NULL,	'UG',	2,	34,	67709,	154,	540,	3630,	25009,	NULL,	'Apollo Kaggwa Road, opp.Shell Petrol Station',	NULL,	'',	'',	NULL,	0,	'2014-10-07',	279,	137,	NULL,	NULL,	'Bishop Joshua Lwere is the General Overseer of the National Fellowship of Born again Pentecostal Churches of Uganda (NFBPC). He is the \r\nDirector of Grace Christian Center Charitable Trust and Director Grace Community Support Program. He is also the Founder and Senior Pastor of Grace Assembly. Bp. Joshua is also a local Council Chief of his village.\r\n\r\nBp. Joshua is very passionate about National Transformation and particularly operates in the areas of Business, Civil Society, Conflict Resolution, Development, Internally Displaced, Humanitarian Relief, Social Entrepreneurship. He is married to Margaret Lwere and God has blessed them with four children, including twins.\r\n\r\nNATIONAL FELLOWSHIP INVOLVEMENT\r\n\r\nHave been part of this Fellowship since the day of its inception.Witnessed the establishment of this Fellowship on 19th February 1990 in Timothy Class, at Watoto Church (then KPC) by the Late Hon Balak Kirya.\r\n\r\nClerk of NFBPC for 1998 - 2007\r\nLegal Advisor for the Fellowship\r\nDrafted the Constitution of the Fellowship\r\nDrafted and Set up the Structure of the Fellowship \r\nRegistered the Fellowship with Ministry of Internal Affairs\r\nDrafted the Code of Conduct with input from Dr. Mitala & Pr Michael Kyazze \r\n\r\nSet up the Fellowship Secretariat\r\nAdministration & Filing System\r\nMembership Registration system \r\nI set up the Fellowship Data base of member Churches country wide.\r\nMade the Fellowship Diary\r\n\r\nTravelled country-wide \r\nTeaching & explaining what this Fellowship is\r\nRecruiting pastors to join this Fellowship\r\nEstablishing Fellowship structures\r\nWith Dr. Mitala distributing wheel Chairs & meeting district/civic leaders\r\nWorking with Dr. Mitala, I have been involved in the identification, appointment, induction & orientation of the current members of the Elders Council.\r\n\r\nSpecial Services to the Pastors\r\nTraining Pastors in Church Leadership\r\nTraining Pastors in Finance & Church Administration.\r\nHave written books on leadership, finance & administration to help pastors spiritually and practically.\r\nHelping pastors to register their Churches in NGO & CBOs\r\nProvided a Lawyer at my Church Premises to offer subsidised legal services to the Fellowship member pastors\r\n\r\nGeneral Secretary of the Fellowship (2007 - 2013)\r\n\r\n',	1,	NULL,	'1417031436.jpg',	1,	'',	NULL,	'Mrs Christine Margaret Lwere',	'256772493807',	'11',	NULL,	'9',	NULL,	NULL),
